import React from "react";
import { Grid, Image, Container} from  "semantic-ui-react";
import charlotte from './charlotte.jpg';

const About = () => (
  <div>
    <Container>
  <Grid>
    <Grid.Column width={4}>
      <Image src= {charlotte}/>
    </Grid.Column>
    <Grid.Column width={9}>
      <Image src='https://react.semantic-ui.com/images/wireframe/paragraph.png' />
    </Grid.Column>
  </Grid>
  </Container>

  </div>
);

export default About;
